'''
Longest Substring Without Repeating Characters

Given a string, find the length of the longest substring without repeating characters. For example, the longest substring without repeating letters for "abcabcbb" is "abc", which the length is 3. For "bbbbb" the longest substring is "b", with the length of 1.
'''


class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        resultlen = 0;
        slen = len(s);

        self.setx = set();
        # for letter in s :
        #     # print(letter);
        #     self.setx.add(letter);

        # 最大长度
        maxlen = len(self.setx);
        self.i = 0;
        self.j = 0;
        while self.i < slen:
            while self.j < slen:
                if s[self.j] in self.setx:

                    self.move_ij(s, slen);
                    break;
                else :
                    self.setx.add(s[self.j]);

                resultlen = max(resultlen, self.j-self.i+1);

                self.j += 1;

            self.i += 1;

        return resultlen;


    def move_ij(self, s, slen):
        while self.i < slen:
            if s[self.i] != s[self.j]:
                self.setx.discard(s[self.i]);
                # self.i += 1;
            else :
                break;

            self.i += 1;

        self.j += 1;
        # self.setx.discard(s[self.i]);
        # self.i += 1;

    def lengthOfLongestSubstring1(self, s):
        """
        :type s: str
        :rtype: int
        """
        resultlen = 0;
        slen = len(s);

        setx = set();
        for letter in s :
            # print(letter);
            setx.add(letter);

        # 最大长度
        maxlen = len(setx);
        for varlen in range(maxlen, 0, -1):
            # print(varlen);
            for varbeg in range(0, slen):
                if varbeg + varlen >= slen:
                    break;
                # get one substr, check it
                if self.check_substr(s, varbeg, varlen):
                    resultlen = varlen;
                    return resultlen;

        return resultlen;

    def check_substr(self, s, varbeg, varlen):
        tempset = set();
        for i in range(varbeg, varbeg+varlen):
            if s[i] in tempset:
                return False;
            else:
                tempset.add(s[i])

        return True;



